from ntstatus._thirtytwobits import ThirtyTwoBits

NTSTATUS_LOOKUP: dict[int, ThirtyTwoBits] = dict()

def cached_ntstatus(code: int, name: str) -> ThirtyTwoBits:
    if code in NTSTATUS_LOOKUP:
        return NTSTATUS_LOOKUP[code]

    bits = ThirtyTwoBits(code, name)
    NTSTATUS_LOOKUP[bits.signed_value] = bits
    NTSTATUS_LOOKUP[bits.unsigned_value] = bits
    return bits

